import react from "react";
// importing components
import Header from "../components/Header";
import RegisterAd from "../components/RegisterAd";

const LandingPage = () => {
  return (
    <div className="landing-page">
      <Header />
      <div className="page-top">
        <RegisterAd />
      </div>
    </div>
  );
};

export default LandingPage;
